If you're curious to see how our JS function shim will be eliminated entirely, let's take a look at the generated bindings. We're starting off with this: const __wbg_bar_target = Foo.prototype.bar; export function __wbg_bar_a81456386e6b526f(arg0, arg1, arg2) { let varg1 = getStringFromWasm(arg1, arg2); return addHeapObject(__wbg_bar_target.call(getObject(arg0), varg1));
} ... and once the reference types proposal is implemented then we won't need some of these pesky functions. That'll transform our generated JS shim to look like: const __wbg_bar_target = Foo.prototype.bar; export function __wbg_bar_a81456386e6b526f(arg0, arg1, arg2) { let varg1 = getStringFromWasm(arg1, arg2); return __wbg_bar_target.call(arg0, varg1);
} Getting better! Next up we need the host bindings proposal. Note that the proposal is undergoing some changes right now so it's tough to link to reference documentation, but it suffices to say that it'll empower us with at least two different features. First, host bindings promises to provide the concept of "argument conversions". The arg1 and arg2 values here are actually a pointer and a length to a utf-8 encoded string, and with host bindings we'll be able to annotate that this import should take those two arguments and convert them to a JS string (that is, the host should do this, the WebAssembly engine). Using that feature we can futher trim this down to: const __wbg_bar_target = Foo.prototype.bar; export function __wbg_bar_a81456386e6b526f(arg0, varg1) { return __wbg_bar_target.call(arg0, varg1);
} And finally, the second promise of the host bindings proposal is that we can flag a function call to indicate the first argument is the this binding of the function call. Today the this value of all called imported functions is undefined, and this flag (configured with host bindings) will indicate the first argument here is actually the this. With that in mind we can further transform this to: export const __wbg_bar_a81456386e6b526f = Foo.prototype.bar; and voila! We, with reference types and host bindings , now have no JS function shim at all necessary to call the imported function. Additionally future wasm proposals to the ES module system may also mean that don't even need the export const ... here too. It's also worth pointing out that with all these wasm proposals implemented the default way to import the bar function (aka structural) would generate a JS function shim that looks like: export function __wbg_bar_a81456386e6b526f(varg1) { return this.bar(varg1);
} where this import is still subject to runtime prototype chain lookups and such.

