The above strategy is useful when JS objects are only temporarily used in Rust, for example only during one function call. Sometimes, though, objects may have a dynamic lifetime or otherwise need to be stored on Rust's heap. To cope with this there's a second half of management of JS objects, naturally corresponding to the other side of the JS heap array. JS Objects passed to wasm that are not references are assumed to have a dynamic lifetime inside of the wasm module. As a result the strict push/pop of the stack won't work and we need more permanent storage for the JS objects. To cope with this we build our own "slab allocator" of sorts. A picture (or code) is worth a thousand words so let's show what happens with an example. // foo.rs
#[wasm_bindgen]
pub fn foo(a: JsValue) { // ...
} Note that the & is missing in front of the JsValue we had before, and in Rust parlance this means it's taking ownership of the JS value. The exported ES module interface is the same as before, but the ownership mechanics are slightly different. Let's see the generated JS's slab in action: import * as wasm from './foo_bg'; // imports from wasm file const heap = new Array(32);
heap.push(undefined, null, true, false);
let heap_next = 36; function addHeapObject(obj) { if (heap_next === heap.length) heap.push(heap.length + 1); const idx = heap_next; heap_next = heap[idx]; heap[idx] = obj; return idx;
} export function foo(arg0) { const idx0 = addHeapObject(arg0); wasm.foo(idx0);
} export function __wbindgen_object_drop_ref(idx) { heap[idx ] = heap_next; heap_next = idx;
