use wasm_bindgen::Clamped;
use web_sys::{CanvasRenderingContext2d, ImageData}; #[wasm_bindgen]
pub fn draw( ctx: &CanvasRenderingContext2d, width: u32, height: u32, real: f64, imaginary: f64,
) -> Result<(), JsValue> { // The real workhorse of this algorithm, generating pixel data let c = Complex { real, imaginary }; let mut data = get_julia_set(width, height, c); let data = ImageData::new_with_u8_clamped_array_and_sh(Clamped(&mut data), width, height)?; ctx.put_image_data(&data, 0.0, 0.0)
